# We need to find the sum of all numbers less than 200 that are either prime or have more than 3 factors.

# Step 1: Define the set of primes less than 200.
# Step 2: Identify the numbers with more than 3 factors (composite numbers with more than 3 factors).
# Step 3: Calculate the sum of these numbers.

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def count_factors(n):
    count = 0
    for i in range(1, int(n ** 0.5) + 1):
        if n % i == 0:
            count += 1
            if i != n // i:
                count += 1
    return count

# Numbers less than 200
limit = 200
sum_of_numbers = 0

# Step 1: Collect primes and numbers with more than 3 factors
for num in range(1, limit):
    if is_prime(num) or count_factors(num) > 3:
        sum_of_numbers += num

